import './App.css';
import InputArea from './InputArea';
import ButtonPropt from './ButtonPropt';
import TableFunc from './TableFunc';

var row = 1
var column = 3

function App() {
  return (
    <div className="Field">
      <h1>Kepner-Tregoe Method</h1>
      <div className="First-Buttons-Part">
        <ButtonPropt name="Add Parameter" color={"lightblue"}/>
        <ButtonPropt name="Add Alternative" color={"lightblue"}/>

      </div>
      <div className="Input-Area">
        <TableFunc rowSize={row} columnSize={column}/>
      </div>
      <div className="Second-Buttons-Part">
        <ButtonPropt name="Calculate" color={"green"}/>
        <ButtonPropt name="Reset Form" color={"yellow"}/>
      </div>
    </div>
  );
}

export default App;
